import React, { Component } from 'react';
import { listarConsultas } from "./../../services/consultas";


class Sessao2 extends Component{
    constructor(props){
        super(props);
        this.state = {
            realizadas: [],
            marcadas : []
        };
    }
    
    componentDidMount(){
        listarConsultas().then(dados => this.setState(dados));
    }

    render(){
        return(
            <div>
                <h2 className="mt-2">Consultas</h2>
                <div className="row">
                    <div className="col">
                        <div className="card mt-2">
                            <div className="cad-header">
                                Realizadas
                            </div>
                            <table className="table">
                                <thead>
                                    <tr>
                                        <th>Especialidade</th>
                                        <th>Quantidade</th>
                                    </tr>
                                </thead>
                                <tbody>
                                    {
                                        this.state.realizadas.map((item, indice) => {
                                            return(
                                                <tr key={indice}>
                                                    <td>{item.especialidade}</td>
                                                    <td>{item.quantidade}</td>
                                                </tr>
                                            )
                                        })
                                    }
                                </tbody>
                            </table>
                        </div>
                    </div>
                    <div className="col">
                        <div className="card mt-2">
                            <div className="cad-header">
                                Marcadas
                            </div>
                            <table className="table">
                                <thead>
                                    <tr>
                                        <th>Especialidade</th>
                                        <th>Quantidade</th>
                                    </tr>
                                </thead>
                                <tbody>
                                    {
                                        this.state.marcadas.map((item, indice) => {
                                            return(
                                                <tr key={indice}>
                                                    <td>{item.especialidade}</td>
                                                    <td>{item.quantidade}</td>
                                                </tr>
                                            )
                                        })
                                    }
                                </tbody>
                            </table>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}

export default Sessao2;
